var title_f0_7_118="Pelosi cesarean technique 1";
var content_f0_7_118=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F82474%7EOBGYN%2F68054%7EOBGYN%2F59263%7EOBGYN%2F59263%7EOBGYN%2F66859&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F82474%7EOBGYN%2F68054%7EOBGYN%2F59263%7EOBGYN%2F59263%7EOBGYN%2F66859&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 566px\">",
"   <div class=\"ttl\">",
"    Abdominal incision in the Pelosi technique",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 546px; height: 510px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) A low transverse suprapubic skin incision is made with a scalpel. The subcutaneous tissue and rectus fascia are incised transversely with electrocautery knife; the subcutaneous tissue is not stripped from the fascia beyond what is needed to expose the cut edges of the fascia. (B) The linea alba is exposed by pulling up the superior edge of the abdominal incision. The traditional dissection of the superior and inferior aspects of the fascia from underlying rectus and pyramidal muscles is not routinely performed. (C) To expose the peritoneum the rectus muscles are separated in the midline by vertical digital dissection. (D) The peritoneum is opened by finger perforation. (E) The peritoneal opening is then extended digitally by vertical and lateral traction. When the peritoneum can not be perforated or stretched digitally, a scalpel or scissors can be used. (F) The full thickness of the abdominal incision is then stretched transversely using the surgeon's fingers.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Marco Pelosi, MD and Marco Pelosi III, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 566px\">",
"   <div class=\"ttl\">",
"    Placement of the self-retaining abdominal retractor  as part of the Pelosi technique",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 546px; height: 486px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) At left, the protractor (Weck Closure Systems); at right, the Mobius (Apple Medical Corporation). (B) The inner ring is squeezed cephalad into the peritoneal cavity. (C) The inner ring springs open against the parietal peritoneum. A digital check is performed to assure that no tissue is trapped between the inner ring and the abdominal wall. The plastic sleeve is then placed on tension. (D) The outer ring is rolled into the plastic sleeve until the ring completely inverts. (E) The result is the creation of an atraumatic, circular, self-retaining area of retraction. (F) A small transverse incision is made with the scalpel approximately one cm above the vesicouterine peritoneal fold. The creation of the traditional bladder flap is avoided.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Marco Pelosi, MD and Marco Pelosi III, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 566px\">",
"   <div class=\"ttl\">",
"    Delivery and hysterotomy in the Pelosi cesarean technique",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 546px; height: 488px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) A digital vertical extension of the hysterotomy incision is made. The vertical extension may be more efficient than traditional transverse extension. (B) The fetal head is delivered with the support of the surgeon's hand. (C) When head extraction cannot be accomplished using one hand assisted by concomitant fundal pressure, the soft vacuum cup can be employed. (D) Breech delivery is accomplished using standard extraction maneuvers. (E) Following spontaneous separation the placenta is removed by fundal pressure and light cord traction. (F) The hysterotomy is repaired either in situ using a single layer closure or by exteriorizing the uterus and using a double layer closure. When needed, hemostatic individual figure-of-eight sutures are also placed.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Marco Pelosi, MD and Marco Pelosi III, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 566px\">",
"   <div class=\"ttl\">",
"    Delivery and hysterotomy in the Pelosi cesarean technique",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 546px; height: 488px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) A digital vertical extension of the hysterotomy incision is made. The vertical extension may be more efficient than traditional transverse extension. (B) The fetal head is delivered with the support of the surgeon's hand. (C) When head extraction cannot be accomplished using one hand assisted by concomitant fundal pressure, the soft vacuum cup can be employed. (D) Breech delivery is accomplished using standard extraction maneuvers. (E) Following spontaneous separation the placenta is removed by fundal pressure and light cord traction. (F) The hysterotomy is repaired either in situ using a single layer closure or by exteriorizing the uterus and using a double layer closure. When needed, hemostatic individual figure-of-eight sutures are also placed.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Marco Pelosi, MD and Marco Pelosi III, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 566px\">",
"   <div class=\"ttl\">",
"    Closure using Pelosi technique",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 546px; height: 500px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Exteriorization of the uterus through the abdominal incision is easily accomplished. (B) Following completion of the hysterotomy closure, the self-retaining retractor is removed. (C) The visceral and parietal peritoneum are not closed. (D) No suture approximation of the rectus muscles is performed. The fascia is closed in a continuous, non-locking fashion with delayed-absorbable sutures placed at least one cm from the fascial wound edge (arrows). (E) The subcutaneous tissue is not closed except when this layer is &ge;2 cm thick. The skin is closed with subcuticular sutures, or (F) metal staples.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Marco Pelosi, MD and Marco Pelosi III, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
