var script_f0_7_122=[""].join("\n");
var outline_f0_7_122=null;
var title_f0_7_123="Adrenal steroid synthesis";
var content_f0_7_123=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F70372&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F70372&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 571px\">",
"   <div class=\"ttl\">",
"    Synthetic pathways for adrenal steroid synthesis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 551px; height: 297px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The first step in adrenal steroid synthesis is the combination of acetyl CoA and squalene to form cholesterol, which is then converted into pregnenolone. The enclosed area contains the core steroidogenic pathway utilized by the adrenal glands and gonads.",
"    <div class=\"footnotes\">",
"     17&alpha;: 17&alpha;-hydroxylase (CYP17, P450c17); 17,20: 17,20 lyase (also mediated by CYP17); 3&beta;: 3&beta;-hydroxysteroid dehydrogenase; 21: 21-hydroxylase (CYP21A2, P450c21); 11&beta;: 11&beta;-hydroxylase; (CYP11B1, P450c11); 18 refers to the two-step process of aldosterone synthase (CYP11B2, P450c11as), resulting in the addition of an hydroxyl group that is then oxidized to an aldehyde group at the 18-carbon position; 17&beta;R: 17&beta;-reductase; 5&alpha;R: 5&alpha;-reductase; DHEA: dehydroepiandrosterone; DHEAS: DHEA sulfate; A: aromatase (CYP19); SK: sulfokinase; SL: sulfotransferase.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f0_7_123=[""].join("\n");
var outline_f0_7_123=null;
var title_f0_7_124="Leukocoria";
var content_f0_7_124=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F56724&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F56724&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Unilateral leukocoria",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 390px; height: 218px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The parents of this 18-month-old child noticed a difference between the two eyes in a family photograph and alerted their pediatrician. The child was subsequently referred to an ophthalmologist and diagnosed with retinoblastoma in the left eye, which is directly visible through the pupil as an abnormal white reflex (leukocoria).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul L Kaufman, MD and Richard A Saunders, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
