" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 488px\">",
"   <div class=\"ttl\">",
"    Delee Simpson type forceps",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 468px; height: 250px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Simpson type forceps have parallel separated shanks with blades that have a long and tapered cepahlic curve.",
"    <div class=\"footnotes\">",
"    </div>",
